import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";
import User from "./User";
import './index.css'


ReactDOM.createRoot(document.getElementById("root")).render(
    <StrictMode>
     <>
     <div className="props">
     < User name='Hossein' age={21} job = 'Front Developer'/>
     < User name='AmirHossein' age={22} job = 'Trade'/>
     < User name='AmirMohammad' age={17} job ='Machanic'/>
     </div>
     </> 
    </StrictMode>
  );
